		["Id"] = 3000090307,
		["UpdateId"] = 1871099111,
		["Contents"] = "Three phase fight. Fight ends when ||cFFFFFF33N'zoth||r dies.\nDon't let your ||cff00ff00Sanity Bar||r reach 0!\n\n||cffff00ffMind Realm||r:\n ||cffff9933NEVER||r stand in ||cff00ffffAnguish||r left behind by ||cff00ffffCreeping Anguish||r.\n ||cffff9933KILL||r ||cFFFFFF33Exposed Synapse||rs when ||cFFFFFF33Psychus||r stands on top of them.\n ||cffffff00Tanks||r: ||cffff9933KITE||r  ||cFFFFFF33Psychus||r in a circle so the group ends up at their bodies. Ensure ||cff00ffffCreeping Anguish||r is dropped far away from bodies.\n\n||cffff9933MIND REALM GROUP:||r \n ||cff00ff00Initial:||r Whole Raid.\n ||cff00ff00First Mind Gate:||r Group ||cffffff001||r and ||cffffff003||r\n ||cff00ff00Second Mind Gate:||r Group ||cffffff002||r and ||cffffff004||r\n||cffff00ffUse your Heart to restore to 100 Sanity right before you enter Mind Realm.||r\n\n||cffff00ffTransistion||r:\n ||cffff9933DPS||r ||cFFFFFF33N'Zoth||r when he get ||cff00ffffShattered Ego||r from ||cFFFFFF33Psychus||r dying.\n ||cffff9933KILL||r any adds left alive.\n ||cffff9933THEN DPS||r ||cFFFFFF33Corrupted Neuron||rs between ||cFFFFFF33N'Zoth||r and ||cFFFFFF33Square marker||r\n ||cffff9933MOVE||r close to ||cFFFFFF33N'Zoth||r OR behind ||cFFFFFF33Square marker||r depending on pull from ||cff00ffffMindgrasp||r\n\n||cffff00ffPhysical Realm||r:\n ||cffff9933DPS PRIORITY:||r ||cFFFFFF33Basher Tentacle||r -> ||cFFFFFF33Corruptor Tentacle||r -> ||cFFFFFF33Spike Tentacle||r \n ||cffff9933DODGE||r ||cff00ffffCorrupted Viscera||r from adds dying.\n ||cffffff00Tanks||r: ||cffff9933TANK||r the ||cFFFFFF33Basher Tentacle||r.\n ||cffffff00Everyone||r: ||cffff9933INTERRUPT||r the ||cFFFFFF33Corruptor Tentacle||r's ||cff00ffffCorrupted Mind||r casts. \n ||cffffff00Healers||r ||cffff9933DISPELL||r any ||cff00ffffCorrupted Mind||r debuffs that go through.\n ||cffffff00Everyone||r: ||cffff9933FIND||r your ||cff00ffffParanoia||r partner and  ||cffff9933STACK||r with them, ||cffff9933AVOIDING||r others.\n||cffff00ffNote that the Tentacles spawn in the same location every time.||r\n\n||cffff00ffLast Phase||r:\n ||cffff9933POP||r ||cff00ffffHeroism||r and DPS Cooldowns.\n ||cffff9933STACK||r close to ||cFFFFFF33N'Zoth||r.\n ||cffff9933DPS PRIORITY:||r ||cFFFFFF33Thought Harvester||r -> ||cFFFFFF33N'Zoth||r\n ||cffff9933SOAK||r ||cff00ffffHarvest Thoughts||r cast by ||cFFFFFF33Thought Harvester||r.\n ||cffff9933MOVE||r as a a group when ||cff00ffffAnguish||r debuff expires.\n ||cffff9933AVOID||r beams from ||cff00ffffStupefying Glare||r.\n ||cffff9933MOVE||r close to ||cFFFFFF33N'Zoth||r OR to dege of room depending on pull from ||cff00ffffMindgrasp||r\n||cffff00ffUse your Heart whenever you're low on Sanity.||r",
		["Backup"] = "Three phase fight. Fight ends when ||cFFFFFF33N'zoth||r dies.\nDon't let your ||cff00ff00Sanity Bar||r reach 0!\n\n||cffff00ffMind Realm||r:\n ||cffff9933NEVER||r stand in ||cff00ffffAnguish||r left behind by ||cff00ffffCreeping Anguish||r.\n ||cffff9933KILL||r ||cFFFFFF33Exposed Synapse||rs when ||cFFFFFF33Psychus||r stands on top of them.\n ||cffffff00Tanks||r: ||cffff9933KITE||r  ||cFFFFFF33Psychus||r in a circle so the group ends up at their bodies. Ensure ||cff00ffffCreeping Anguish||r is dropped far away from bodies.\n\n||cffff9933MIND REALM GROUP:||r \n ||cff00ff00Initial:||r Whole Raid.\n ||cff00ff00First Mind Gate:||r Group ||cffffff001||r and ||cffffff003||r\n ||cff00ff00Second Mind Gate:||r Group ||cffffff002||r and ||cffffff004||r\n||cffff00ffUse your Heart to restore to 100 Sanity right before you enter Mind Realm.||r\n\n||cffff00ffTransistion||r:\n ||cffff9933DPS||r ||cFFFFFF33N'Zoth||r when he get ||cff00ffffShattered Ego||r from ||cFFFFFF33Psychus||r dying.\n ||cffff9933KILL||r any adds left alive.\n ||cffff9933THEN DPS||r ||cFFFFFF33Corrupted Neuron||rs between ||cFFFFFF33N'Zoth||r and ||cFFFFFF33Square marker||r\n ||cffff9933MOVE||r close to ||cFFFFFF33N'Zoth||r OR behind ||cFFFFFF33Square marker||r depending on pull from ||cff00ffffMindgrasp||r\n\n||cffff00ffPhysical Realm||r:\n ||cffff9933DPS PRIORITY:||r ||cFFFFFF33Basher Tentacle||r -> ||cFFFFFF33Corruptor Tentacle||r -> ||cFFFFFF33Spike Tentacle||r \n ||cffff9933DODGE||r ||cff00ffffCorrupted Viscera||r from adds dying.\n ||cffffff00Tanks||r: ||cffff9933TANK||r the ||cFFFFFF33Basher Tentacle||r.\n ||cffffff00Everyone||r: ||cffff9933INTERRUPT||r the ||cFFFFFF33Corruptor Tentacle||r's ||cff00ffffCorrupted Mind||r casts. \n ||cffffff00Healers||r ||cffff9933DISPELL||r any ||cff00ffffCorrupted Mind||r debuffs that go through.\n ||cffffff00Everyone||r: ||cffff9933FIND||r your ||cff00ffffParanoia||r partner and  ||cffff9933STACK||r with them, ||cffff9933AVOIDING||r others.\n||cffff00ffNote that the Tentacles spawn in the same location every time.||r\n\n||cffff00ffLast Phase||r:\n ||cffff9933POP||r ||cff00ffffHeroism||r and DPS Cooldowns.\n ||cffff9933STACK||r close to ||cFFFFFF33N'Zoth||r.\n ||cffff9933DPS PRIORITY:||r ||cFFFFFF33Thought Harvester||r -> ||cFFFFFF33N'Zoth||r\n ||cffff9933SOAK||r ||cff00ffffHarvest Thoughts||r cast by ||cFFFFFF33Thought Harvester||r.\n ||cffff9933MOVE||r as a a group when ||cff00ffffAnguish||r debuff expires.\n ||cffff9933AVOID||r beams from ||cff00ffffStupefying Glare||r.\n ||cffff9933MOVE||r close to ||cFFFFFF33N'Zoth||r OR to dege of room depending on pull from ||cff00ffffMindgrasp||r\n||cffff00ffUse your Heart whenever you're low on Sanity.||r",
